import React from "react";
import Navigation from "../../../global-components/Navigation/Navigation";
import PageStyles from "../styles/active-user-styles.module.scss";


function ActiveUserMainPage() {
  return (
    <div className={PageStyles.activeMainPagewrapper}>
      <div className={PageStyles.navWrapper}>
        <Navigation color="#FFFFFF" pageName={"Подписки"} />
      </div>
      <section className={PageStyles.cashbackActiveServiceWrapper}>
      <div className="grid-container">
  <div className="grid-item period-cashback">
    <div className="icon">icon</div>
    <div className="text">Кешбэк за весь период</div>
    <div className="amount">+ 1496 ₽</div>
  </div>
  <div className="grid-item month-cashback">
    <div className="text">Кешбэк в этом месяце</div>
    <div className="amount">+ 496 ₽</div>
  </div>
  <div className="grid-item month-expenses">
    <div className="text">Расходы в этом месяце</div>
    <div className="amount">- 1296 ₽</div>
  </div>
</div>

      </section>

    </div>
  );
}

export default ActiveUserMainPage;
